import "./Navbar.css";

const Navbar = () => {
  return (
    <nav className="navbar">
      <h1>HToan Blog</h1>
      <div className="links">
        <h2>
          <a href="/">Home</a>
        </h2>
        <h2>
          <a href="/create">Create A New Blog</a>
        </h2>
      </div>
    </nav>
  );
};

export default Navbar;
